function randomColor() {
  const colors = ["Green", "Yellow", "Red", "Orange", "Blue", "Purple", "Violet", "Gold", "White", "Turquoise", "Teal", "Coral", "Magenta", "Maroon", "Lavender", "Navy", "Olive", "Plum", "Salmon", "Tan", "Peach", "Sky blue", "Mint green", "Rose", "Lilac", "Mustard", "Orchid", "Slate gray"];
  const color = colors[Math.floor(Math.random() * colors.length)];
  return color;
}
export default randomColor;
